script: |
  super -f text -I q2298.spq | sort > q2298.out

inputs:
  - name: q2298.spq
    data: |
      SELECT + + 60 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 + - col2 + - col0 * col2 * + 91 + - - 54 + - + 76 + 43 IS NULL;
  - name: tab1

outputs:
  - name: q2298.out
    data: |
      60
      60
      60
